INSERT INTO `genericUser_announcement` VALUES (2,'雲端千眼線上校對志工說明文件','<p>各位志工朋友，讓我們一起在雲端上相會哦！（<a href=\"../\" target=\"_blank\" rel=\"noopener\">https://www.edocumentservice.org/</a>）</p>\n<p>需要服務時數、想貢獻自己一份力量的各位志工們，雲端千眼線上校對工作是一個不限時間、不限地點都能夠投入的志願服務工作，只要您上網註冊後，就能夠以志工的身份領取書籍進行校對，想要詳細的瞭解更多資訊嗎？快點下載雲端千眼線上校對說明文件吧！</p>\n<p>雲端千眼線上校對說明文件：<a href=\"https://drive.google.com/file/d/0B64Dl4rrX8UeTEFmZEg2b18yS1E/view?usp=sharing\" target=\"_blank\" rel=\"noopener\">點此下載</a></p>\n<p>Tips：服務時數是由系統偵側您的校對工作情形並自動累積（登入時數不代表服務時數哦），每份文件（50頁）領取後需於五天內校對完畢，超過時限文件將會自動收回並將時數累計給最後完成的人員。</p>','2017-10-24','志工快訊'),(3,'歡迎一起加入雲端千眼平台','<p>各位平台使用者大家好</p>\n<p>這裡是一個致力於閱讀平權推廣的平台，我們希望透過雲端上所有志工的協助，能夠<strong><span style=\"color: #ff6600;\">穩定且客製化</span></strong>的提供視障者想要閱讀的書籍電子檔。十分感謝投入在線上校對的志工們，也鼓勵每一位視覺障礙者來使用並珍惜平台的資源，為保護著作權人的權益，目前平台上所有重製完成的書籍，僅限提供給領有視覺障礙手冊的身心障礙者閱讀，因此是不能將下載的書籍流通轉載哦！平台會持續努力針對平台操作界面和功能進行改善和優化，也希望大家都能夠多多支持嚕！</p>\n<p>如果在平台操作上有任何的問題或建議，都歡迎直接來電（02-27177722#20）或來信（a9203045@forblind.org.tw）詢問，另外在平台頁面的右下角也有一個<span style=\"color: #0000ff;\"><strong>網路客服系統</strong></span>，當顯示線上時可直接與服務人員交談詢問，或是於離線時留言，我們都會儘快回覆或與您聯繫。</p>\n<p style=\"text-align: right;\">雲端千眼服務團隊&nbsp; 謹致</p>','2017-10-25','平台消息');
/*!40000 ALTER TABLE `genericUser_announcement` ENABLE KEYS */;
